import React, {useState,useEffect} from 'react';
import axios from 'axios';
import DiscountCard from '../reusable/DiscountCard';



function DiscountCardList(){
    const[discountCards, setDiscountCards] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8083/discount_card")
        .then(response => {
            setDiscountCards(response.data);
        })
        .catch(error => {
            console.error("Error fetching discount cards:", error);
        });
    },[]);

    return (
        <div className="card-list">
            {discountCards.map (card => (
                <DiscountCard
                key={card.id}
                title={card.title}
                description={card.description}
                />
            ))}
        </div>
    );
}
export default DiscountCardList;
